/*!50003 CREATE*/ /*!50020 DEFINER=`remoteadmin`@`213.188.228.86`*/ /*!50003 PROCEDURE `payroll_prc_employee`()
BEGIN
	DECLARE datePeriodStart DATE;
	DECLARE datePeriodEnd DATE;

	SELECT CONCAT(payroll_year_ID,'-',major_period,'-01'), LAST_DAY(CONCAT(payroll_year_ID,'-',major_period,'-01')) INTO datePeriodStart,datePeriodEnd FROM payroll_period WHERE major_period<13 ORDER BY payroll_year_ID DESC, major_period DESC LIMIT 1;

	START TRANSACTION;

	UPDATE payroll_employee SET RetirementDate=IF(Sex='M',DATE_ADD(DateOfBirth, INTERVAL 65 YEAR),DATE_ADD(DateOfBirth, INTERVAL 64 YEAR)), Age=(YEAR(CURDATE())-YEAR(DateOfBirth))-(RIGHT(CURDATE(),5)<RIGHT(DateOfBirth,5)), AgeAtPeriodStart=(YEAR(datePeriodStart)-YEAR(DateOfBirth))-(RIGHT(datePeriodStart,5)<RIGHT(DateOfBirth,5)), AgeAtPeriodEnd=(YEAR(datePeriodEnd)-YEAR(DateOfBirth))-(RIGHT(datePeriodEnd,5)<RIGHT(DateOfBirth,5)), YearsOfService=YEAR(CURDATE())-YEAR(SeniorityJoining), MonthsOfService=MONTH(CURDATE())-MONTH(SeniorityJoining);
	UPDATE payroll_employee SET YearsOfService=YearsOfService-1, MonthsOfService=MonthsOfService+12 WHERE MonthsOfService<0;
	UPDATE payroll_employee SET YearsOfService=0, MonthsOfService=0 WHERE YearsOfService<0;

	COMMIT;
END */;;
DELIMITER ;
